import { createApp } from 'vue'
import App from './App.vue'
import store from './store'
import Vue from 'vue'

ymaps.ready(() => {
  const map = new ymaps.Map('map', {
    center: [59.938955, 30.315644],
    zoom: 10,
    controls: [],
  })
  Vue.prototype.$map = map;
})

createApp(App).use(store).mount('#app')
